import React, { Component } from 'react'

export default class Parent extends Component {
  render() {
    console.log(1)
    return (
      <div>
        <h3>我是Parent组件</h3>
        <Child />
      </div>
    )
  }
}

class Child extends Component {
    
  render() {
    return (
      <div>
        <h3>我是Child组件</h3>
      </div>
    )
  }
}
